import NavBar from "../../Components/NavBarHome";
import HeaderHome from "../../Components/HeaderHome";
import MainHome from "../../Components/MainHome";
import { useState, useEffect, useContext } from "react";
import Modal from "../../Components/Modal";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { UserContext } from "../../Context/UserContext";
function Home() {
  const Navigate = useNavigate();
  const [modalOn, setModalOn] = useState(false);
  const [dadosUsuario, setDadosUsuario] = useState("");
  const [techArray, setTechArray] = useState([]);
  const { userData } = useContext(UserContext);
  const token = localStorage.getItem("@token");

  useEffect(() => {
    if (userData === null) {
      Navigate("/login");
    }
  }, []);

  useEffect(() => {
    const data = {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    };
    axios
      .get("https://kenziehub.herokuapp.com/profile", data)
      .then((res) => {
        console.log(res);
        setDadosUsuario(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  useEffect(() => {
    setTimeout(() => {
      console.log(dadosUsuario.techs);
      setTechArray(dadosUsuario.techs);
      console.log(techArray);
    }, 2000);
  }, []);

  return (
    <div>
      <NavBar />
      <HeaderHome dadosUsuario={dadosUsuario} />
      <MainHome
        setModal={setModalOn}
        techArray={techArray}
        setTechArray={setTechArray}
      />
      {modalOn ? (
        <Modal setModal={setModalOn} setTechArray={setTechArray} />
      ) : null}
    </div>
  );
}
export default Home;
